import React from 'react';
import RoomComp from './RoomComp'; // Assuming you have a Room component

const RoomList = ({ rooms }) => {
  return (
    <div className="room-list">
      <h2>Room List</h2>
      <ul>
        {rooms.map(room => (
          <RoomComp key={room._id} room={room} />
        ))}
      </ul>
    </div>
  );
};

export default RoomList;
